import { useEffect, useState } from "react";
import { connect } from "react-redux";
import axios from "axios";
import getItem from "./Redux/action/itemAction";
import incr from "./Redux/action/action";
import { decr } from "./Redux/action/action";

function Items(props) {
  return (
    <>
      <h2>All Items</h2>
      {props.statvalue}
      <button onClick={props.incr}>increment</button>
      <button onClick={props.decr}>decrement</button>
    </>
  );
}

const mapStateToProps = (state) => ({
  statvalue: state,
});
export default connect(mapStateToProps, { incr, decr })(Items);
